import React, {Fragment} from "react";


import 'bootstrap/dist/css/bootstrap.min.css';

const InputTodo = () => {
    return (
        <Fragment>
            <h1 className="text-center mt-5" >Pern Todo List</h1>
            <form>
                <input></input>
                <button type="button"></button>
            </form>
        </Fragment>
    )
}

export default InputTodo;
